import React from 'react';

const Footer = () => {
  const footerStyle = {
    backgroundColor: '#EFE6B3',
    color: '#fff',
    padding: '20px 0',
    textAlign: 'center',
    position: 'fixed',
    bottom: '0',
    width: '100%',
  };

  const infoStyle = {
    margin: '0',
    padding: '5px',
    fontSize: '14px',
  };

  return (
    <footer style={footerStyle}>
      <div style={infoStyle}>
        <p>Email: <a href="mailto:info@tunzawatoto.org" style={{ color: 'black' }}>info@tunzawatoto.org</a></p>
        <p>Phone: +1 (123) 456-7890</p>
        <p>Location: 1234 Tunza Street, Watoto City, Country</p>
      </div>
    </footer>
  );
};

export default Footer;
